import React from "react";
import "./TopNavbar.css";

function TopNavbar({ showAuthButtons }) {
  return (
    <nav className="top-navbar">
      <div className="navbar-title">TooturAI</div>
      <ul className="navbar-links">
        <li>About Us</li>
        <li>Contact Us</li>
        {showAuthButtons && (
          <>
            <li>Login</li>
            <li>Signup</li>
          </>
        )}
      </ul>
    </nav>
  );
}

export default TopNavbar;
